#'           Key = "string",
#'           Value = "string"
#'         )
#'       )
#'     ),
#'     Customizations = list(
#'       WebAcl = list(
#'         Action = "override"|"disable",
#'         Arn = "string"
#'       ),
#'       Certificate = list(
#'         Arn = "string"
#'       ),
#'       GeoRestrictions = list(
#'         RestrictionType = "blacklist"|"whitelist"|"none",
#'         Locations = list(
#'           "string"
#'         )
#'       )
#'     ),
#'     Parameters = list(
#'       list(
#'         Name = "string",
#'         Value = "string"
#'       )
#'     ),
#'     ConnectionGroupId = "string",
#'     CreatedTime = as.POSIXct(
#'       "2015-01-01"
#'     ),
#'     LastModifiedTime = as.POSIXct(
#'       "2015-01-01"
#'     ),
#'     Enabled = TRUE|FALSE,
#'     Status = "string"
#'   ),
#'   ETag = "string"
#' )
#' ```
#'
#' @section Request syntax:
#' ```
#' svc$update_distribution_tenant(
#'   Id = "string",
#'   DistributionId = "string",
#'   Domains = list(
#'     list(
#'       Domain = "string"
